class TweepyMock:
    def __init__(self, **kwargs):
        self.id = kwargs['id']
        self.full_text = kwargs['full_text']
        self.entities = kwargs['entities']
        self.author = kwargs['user']
        self.display_text_range = kwargs['display_text_range']
